import * as React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@mui/material/AppBar';
import { useEffect } from 'react';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import cryptoJs from 'crypto-js';

import IconButton from '@mui/material/IconButton';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Avatar from '@mui/material/Avatar';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import MailIcon from '@mui/icons-material/Mail';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Navigate, useNavigate } from 'react-router-dom';
import "./drawer.css"
const drawerWidth = 240;

function ResponsiveDrawer(props) {
  const navigate=useNavigate();
  const { window } = props;
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  var sinout=userdata?
  {nav:'/si',text:'SIgn IN',icon:''}:{nav:'/so',text:'SIgn out',icon:''};

 let listitems=[
  {nav:'/people',text:'All People',icon:''},
  {nav:'/home',text:'Home',icon:''},
  {nav:'/create',text:'Publish',icon:''},





 ]
let x=['l','k'];
const flexContainer = {
  display: 'flex',
  flexDirection: 'row',
  padding: 0,
};


  const drawer = (
    <div>
      <Toolbar />

      <List>
        {listitems.map((e, index) => (
          <ListItem key={e.text} disablePadding onClick={()=>{
navigate(e.nav)
          }}>

            <ListItemButton>
              <ListItemIcon>
              </ListItemIcon>
              <ListItemText primary={e.text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </div>
  );
var userdata=false;
var CryptoJS=require("crypto-js");
  useEffect(()=>{


    var udata=localStorage.getItem('user');
    if(udata)
   { var bytes  = CryptoJS.AES.decrypt(udata.toString(), 'somekey');
    var decryptedData = JSON.parse(bytes.toString(CryptoJS.enc.Utf8));
    userdata=decryptedData;
    setdata(userdata)
    console.log(userdata)}
    else navigate("/si")
    },[userdata])



  const [data, setdata] = React.useState(false);

  const container = window !== undefined ? () => window().document.body : undefined;
return (<>
 <CssBaseline />

  <div className='Appbar' >
  <span className='tbtn' onClick={handleDrawerToggle} ><MenuIcon/> </span>
  <span>Mylogo </span>
  <div className='links' >
    {listitems.map((e,id)=>{
    return   (<a href={e.nav} key={id}>
       {e.text}
      </a>
    )})
    }



  </div>
  <div style={{display:'flex',alignItems:'center'}}>
    <Avatar> { `${data?data.givenName[0]:' '}`}</Avatar>
   {/* { `${data.givenName}`} */}

  </div>
  </div>
 <Box
        component="div"
        sx={{ width: { sm: 0 ,xs :0}, flexShrink: { sm: 0 } }}
        aria-label="mailbox folders"
      >


        <Drawer
          container={container}
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile.
          }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
        >
          {drawer}
        </Drawer>

      </Box></>)

}



export default ResponsiveDrawer;
